	'wm-license-cc-zero-explanation' => 'Ti tao a tumaripnong ti obra a daytoy a kasuratan ket nairuknoy na ti obra iti [[{{int:wm-license-pd-wiki-link}}|pagturayan a publiko]] babaen ti pangiwagsak iti amin kadagiti karbengan iti obra iti sangalubongan babaen ti karbengan ti kopia a linteg, a mairaman amin a maikabagian ken dagiti karruba a karbengan, iti kalawa a maipalubusan babaen ti linteg. Makopiam, mabaliwam,maiwaras ken itungpal ti obra, uray ti komersial a pang-panggep, amin nga awan ti dumawat ti pammalubos.',
